        background: #eeeeee;
        border: 1px solid #c4c4c4;
        box-sizing: border-box;
        border-radius: 40px;
        h2 {
          color: black;
          text-align: center;
          font-size: 50px;
          font-weight: 300;
        }
      `}</style>
    </div>
  );
};

export default PricingToggle;
